import React from 'react';
import Link from 'next/link';
import Router from 'next/router';

const indexPage = () => (
  <div>
    <h1>The Main Page</h1>
    <p>
      Go to{' '}
      <Link href="/auth">
        <a>Auth</a>
      </Link>
      <button type="button" onClick={() => Router.push('/auth')}>
        Go to Auth
      </button>
    </p>
  </div>
);

export default indexPage;
